  \"2013-03-14T19:26:25.861929\",\n\t\"name\": \"sensitive-sites-ospr-ds358\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The data was created by reviewing the information
  contained in the Site Summaries of the Area Contingency Plan (ACP) section 9800.
  A summary of the document is: \"The essence of spill response contingency planning
  is the identification and protection of environmental, cultural, and economic resources
  at risk. These in combination with geographic constraints that impact spill response
  measures at the respective locales define the response need. This section of the
  ACP addresses both the sensitive locales identified by the respective area committees
  and the geographic as well as access issues, which may significantly effect response
  decisions.\" If the Site Summary contained a latitude/longitude of the location,
  the ArcView Geotools extension was used to create the point shp file. If the coordinate
  was not know, the tool was used to identify the coordinate by selecting the location
  from a georeferenced USGS quad map. The extents were identified from the Site Summary
  and each extents was copied from the 24K Coast shp file or from the Delta Shp file.
  The Xtools extension was used to cut and copy each segment to the extents shp file.\",\n\t\"license_title\":
